from sympy import factorint, prod
def a(n): return 1 if n==1 else prod([2**max(e - 3, 0) if p==2 else (p - 1)*p**(e - 1)//2 for p, e in factorint(n).items()])
print([a(n) for n in range(1, 51)]) # _Indranil Ghosh_, Jul 17 2017

